import "./App.css";
import Main from "./pages/Main.js";
import Navbar from "./pages/Navbar";
import AdminPage from "./pages/AdminPage";
import ItemPage from "./pages/components/ItemPage";
import CartPage from "./pages/components/CartPage";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function User(props) {
	const { id } = props.match.params;

	// use the id prop here...

	return <div>User {id}</div>;
}

function App() {
	return (
		<div className="App">
			<link
				rel="stylesheet"
				href="https://fonts.googleapis.com/css?family=Abhaya Libre"
			/>
			<Router>
				<Routes>
					<Route path="/users/:id" component={User} />
					<Route path="/" element={<Main />} />
					<Route path="/item/:id" element={<ItemPage />} component={ItemPage} />
					<Route path="/Cart" element={<CartPage />} />
				</Routes>
			</Router>
		</div>
	);
}

export default App;
